import React from "react";

function Header() {
    const style = {
            color: "blue",
            fontSize: "40px",
            backgroundColor: "black",
            padding: "20px"
    }
    return(
        <h1 style={style}>APC New Vision For Your Life</h1>
    );
}

export default Header;
